import React, { useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";
import { UserContext } from "./UserContext";
import "./RegisterForm.css";

const RegisterForm = () => {
  const { users, setCurrentUser } = useContext(UserContext);
  const navigate = useNavigate();

  // Lista miast do wyboru
  const cities = ["Warszawa", "Kraków", "Wrocław", "Gdańsk", "Poznań"];

  // Definicja schematu walidacji z Yup
  const validationSchema = Yup.object().shape({
    email: Yup.string().email("Nieprawidłowy adres e-mail").required("Pole jest wymagane"),
    password: Yup.string().required("Pole jest wymagane"),
    confirmPassword: Yup.string()
      .oneOf([Yup.ref("password"), null], "Hasła muszą być identyczne")
      .required("Pole jest wymagane"),
    imieNazwisko: Yup.string().required("Pole jest wymagane"),
    miasto: Yup.string().required("Pole jest wymagane"),
    kategoria: Yup.string().required("Pole jest wymagane"),
  });

  const initialValues = {
    email: "",
    password: "",
    confirmPassword: "",
    imieNazwisko: "",
    miasto: "",
    kategoria: "",
  };

  const handleRegister = (values, { setSubmitting, setFieldError }) => {
    // Sprawdzenie, czy użytkownik już istnieje
    const userExists = users.some((u) => u.email === values.email);
    if (userExists) {
      setFieldError("email", "Użytkownik o podanym adresie e-mail już istnieje");
      setSubmitting(false);
      return;
    }

    // Stworzenie nowego użytkownika (tutaj można by użyć odpowiedniej metody do dodawania użytkownika)
    const newUser = {
      id: users.length + 1, // Przykładowe generowanie ID (w praktyce lepiej użyć UUID lub coś podobnego)
      email: values.email,
      haslo: values.password,
      imieNazwisko: values.imieNazwisko,
      miasto: values.miasto,
      kategoria: values.kategoria,
    };

    // Ustawienie nowego użytkownika jako aktualnie zalogowanego
    setCurrentUser(newUser);
    navigate("/ustawienia-konta"); // Przekierowanie do strony ustawień konta po zarejestrowaniu
  };

  return (    
    <Formik
      initialValues={initialValues}
      validationSchema={validationSchema}
      onSubmit={handleRegister}
    >
      {({ isSubmitting }) => (
        <Form>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">
              E-mail
            </label>
            <Field
              type="email"
              name="email"
              id="email"
              className="form-control"
              placeholder="E-mail"
            />
            <ErrorMessage name="email" component="div" className="alert alert-danger" />
          </div>
          <div className="mb-3">
            <label htmlFor="password" className="form-label">
              Hasło
            </label>
            <Field
              type="password"
              name="password"
              id="password"
              className="form-control"
              placeholder="Hasło"
            />
            <ErrorMessage name="password" component="div" className="alert alert-danger" />
          </div>
          <div className="mb-3">
            <label htmlFor="confirmPassword" className="form-label">
              Potwierdź hasło
            </label>
            <Field
              type="password"
              name="confirmPassword"
              id="confirmPassword"
              className="form-control"
              placeholder="Potwierdź hasło"
            />
            <ErrorMessage
              name="confirmPassword"
              component="div"
              className="alert alert-danger"
            />
          </div>
          <div className="mb-3">
            <label htmlFor="imieNazwisko" className="form-label">
              Imię i Nazwisko
            </label>
            <Field
              type="text"
              name="imieNazwisko"
              id="imieNazwisko"
              className="form-control"
              placeholder="Imię i Nazwisko"
            />
            <ErrorMessage name="imieNazwisko" component="div" className="alert alert-danger" />
          </div>
          <div className="mb-3">
            <label htmlFor="miasto" className="form-label">
              Miasto
            </label>
            <Field
              as="select"
              name="miasto"
              id="miasto"
              className="form-control"
            >
              <option value="">Wybierz miasto...</option>
              {cities.map((city) => (
                <option key={city} value={city}>{city}</option>
              ))}
            </Field>
            <ErrorMessage name="miasto" component="div" className="alert alert-danger" />
          </div>
          <div className="mb-3">
            <label htmlFor="kategoria" className="form-label">
              Kategoria
            </label>
            <Field
              as="select"
              name="kategoria"
              id="kategoria"
              className="form-control"
            >
              <option value="">Wybierz kategorię...</option>
              <option value="Gitary">Gitary</option>
              <option value="Wokal">Wokal</option>
              <option value="Instrumenty klawiszowe">Instrumenty klawiszowe</option>
            </Field>
            <ErrorMessage name="kategoria" component="div" className="alert alert-danger" />
          </div>
          <button
            type="submit"
            className="btn btn-primary"
            disabled={isSubmitting}
          >
            {isSubmitting ? "Przetwarzanie..." : "Zarejestruj się"}
          </button>          
        </Form>
      )}
    </Formik>
  );
};

export default RegisterForm;
